(12, 'About Us', 'About Us', 'The Ministry of Local Government and environment was created in March 2006 with offices located at 85 Hagley Park Road, Kingston 10 and 16A Half-Way-Tree Road, Kingston 10.\r\n<br><br>\r\n1As part of its mandate, the Ministry seeks to promote effective local governance and sustainable development through the development of policies, programmes, plans and standards related to local governance and the environment while monitoring the work of and providing technical support to the agencies within its portfolio.', '2010-10-14', NULL, NULL, 3, 1, 1, 0, 0, NULL, '2010-10-14', '2010-10-15'),
